(6535, NULL, 'We are the 3rd generation as a knifemaker my grand father Mr. Muhammad Abbas Asar (Late), started the knife business in 1952 and my father Mr. Muhammad Saleem (Late), take this business in 1968, my father was most popular man in the knife community through out the Pakistan and some other countries. My love of knives began at an early age. I remember being fascinated with my Dads old &amp; new knives, my father was a meteorologist and enjoyed making every type of knives. Growing up in Sialkot, I and my brother had a small workshop in our house full of knife making tools.\n\nI probably made my first carbon steel blade with stag horn handle folder around the age of 18. Working as a machinist for the past years has kept me constantly around steel and much of the equipment needed to make knives. In 1998, I decided to get serious about what had always been just a hobby. At that time, I began to acquire my own knifemaking equipment so I could work on my knives away from my job. In 1999 I personally started export with the name of Knife Craft Company. The people engaged with this house having 37 years experience in this field.\n\nShortly after our move to new company in the same city, I began developing my first standard knives, what are now my Small Pocket and Medium Hunters. I got my experience from deer, big horn sheep, wild boar &amp; bird hunting in Pakistan and I also considered a lot of feedback from local hunters. My father&#8217;s experience opened my eyes to the importance of other knife techniques; especially he developed Damascus steel in very beautiful patterns and layers in the last days of his life. We never forget his feelings about our training in knifemaking. My father was a wealth of information about knives and he was called king of knives in Pakistan!! Now we both brothers are enjoying the challenges involved in making them.\n\nThe knives&#8230; I feel that my father and the internet knife information have played a very key role in our success as a knifemaker. For us, they provide excellent exposure. This keeps us striving for the highest level of fit, finish and overall quality. Seeing the work of so many talented makers on an internet is quite inspiring, which constantly enable us to improve our craftsmanship in knifemaking. Now my younger brother and I really enjoy making knives in Damascus steel and other materials and never consider it a job.\n\nI appreciate your interest in our knives.\n\nMuhammad Aleem.', 'Sialkot', 'Guns, Pistols, Rifles, Knives and Hunting...', 'Custom Knife Maker', 'Muhammad Aleem'),
